import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import { css } from "@emotion/core";
import "./PageStyles/Home.css";
import Image5 from "./PageStyles/images/image 5.png";

const Home = () => {
  return (
    <div
      className="home"
      css={css`
        height: inherit;
      `}
    >
      <Header />
      <div className="home-container grid-container">
        <div className="image-card">1</div>
        <div className="image-subcontainer">
          <div
            className="image-card"
            style={{
              backgroundImage: "url('./PageStyles/images/image 5.png')",
            }}
          >
            2
          </div>
          <div className="image-card">3</div>
        </div>
        <div className="image-card">4</div>
        <div className="image-card">6</div>
        <div className="image-card">7</div>
      </div>
      <Footer />
    </div>
  );
};

export default Home;
